import re

def extract_details(data):
    lines = data.strip().split('\n')
    name = lines[0].strip()
    email_match = re.search('[\\w\\.-]+@[\\w\\.-]+', data)
    email = email_match.group() if email_match else None
    (job_title, company_name) = (None, None)
    if len(lines) > 2:
        (job_title, company_name) = re.match('(.+) at (.+)', lines[1]).groups()
    return {'name': name, 'email': email, 'job_title': job_title, 'company_name': company_name}

